(992, 3, 'Children\'s interview', 2, 'Michael Palin', 'Michael', 'I want to go home.', '1969-08-14', '1969-10-19'),
(993, 3, 'Children\'s interview', 1, NULL, NULL, 'Shrieks from unseen audience.', '1969-08-14', '1969-10-19'),
