(3472, 10, 'Bank robber (lingerie shop)', 2, 'Eric Idle', 'Assistant', 'Er, we\'ve got corsets, stockings, suspender belts, tights, bras, slips, petticoats, knickers, socks and garters, sir.', '1969-11-30', '1969-12-21'),
